import React from "react";
import PropTypes from "prop-types";

const TercerComponente = ({ nombre }) => {

  if (!nombre) {
    console.warn("⚠️ El nombre es requerido y no fue proporcionado.");
  }

  return <h2>Nombre: {nombre}</h2>;
};

TercerComponente.propTypes = {
  nombre: PropTypes.string.isRequired,
};

export default function App() {
  return (
    <div className="App">
      {/* No se pasa el prop `nombre`, debería generar un warning */}
      <TercerComponente />
    </div>
  );
}
